public class AboutFragment extends BaseFragment {


    public static final String TAG = "AboutFragment_TAG";

    private WebView webView;


    @Nullable
    @Override
    public View onCreateView(@NonNull LayoutInflater inflater, @Nullable ViewGroup container, @Nullable Bundle savedInstanceState) {

        View view = inflater.inflate(R.layout.fragment_about, container, false);

        webView = view.findViewById(R.id.webview);

        return view;
    }

    @Override
    public void onResume() {
        super.onResume();

        StringBuilder builder = new StringBuilder();
        builder.append("<h1 align=\"center\">А тут будет охеренный текст</h1><br><h3>Картиночка нам пришла прямо в html</h3><br><center><img width=\"50%\" src=\"data:image/jpeg;base64,").
                append("").
                append("").
                append("").
                append("").
                append("").
                append("").
                append("").
                append("").
                append("\" alt=\"\" /></center>");

        webView.loadData(builder.toString(), "text/html; charset=UTF-8", null);
    }

}
